  `id` int(11) NOT NULL AUTO_INCREMENT,
  `year` int(11) NULL DEFAULT NULL COMMENT '年份',
  `population` double NULL DEFAULT NULL COMMENT '总人口',
  `growth_popula` double NULL DEFAULT NULL COMMENT '自然增长人口',
  `annual_average` double NULL DEFAULT NULL COMMENT '年平均值',
  `over15` double NULL DEFAULT NULL COMMENT '适婚年龄>15',
  `man` double NULL DEFAULT NULL COMMENT '男性',
  `woman` double NULL DEFAULT NULL COMMENT '女性',
  `newborn` double NULL DEFAULT NULL COMMENT '新生儿数量',
  `newborn_man` double NULL DEFAULT NULL COMMENT '新生儿 男孩',
  `newborn_woman` double NULL DEFAULT NULL COMMENT '新生儿 女孩',
  `death` double NULL DEFAULT NULL COMMENT '死亡人数',
  `total_dependency_ratio` double NULL DEFAULT NULL COMMENT '总抚养比',
  `child_dependency_ratio` double NULL DEFAULT NULL COMMENT '少年抚养比',
  `old_dependency_ratio` double NULL DEFAULT NULL COMMENT '老年抚养比',
  `birth_rate` double NULL DEFAULT NULL COMMENT '出生率',
  `mortality` double NULL DEFAULT NULL COMMENT '死亡率',
  `growth_rate` double NULL DEFAULT NULL COMMENT '自然增长率',
  `first_marriage` double NULL DEFAULT NULL COMMENT '初婚',
  `unmarried` double NULL DEFAULT NULL COMMENT '未婚',
  `remarry` double NULL DEFAULT NULL COMMENT '再婚',
  `divorce` double NULL DEFAULT NULL COMMENT '离婚',
  `y0_y14` double NULL DEFAULT NULL COMMENT '0-14岁',
  `y15_y64` double NULL DEFAULT NULL COMMENT '15-64岁',
  `over65` double NULL DEFAULT NULL COMMENT '大于65岁',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 68 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

